        <style>
            body {
                font-family: "DejaVu Sans", sans-serif;
                background-color: #f2f2f2;
                color: #4d4d4d;
            }

            h1, h2 {
                margin-top: 10px;
                margin-bottom: 0px;
            }

            h2 {
                padding-left: 10px;
            }

            ul {
                list-style-type: none;
                padding-left: 0;
            }

            li {
                margin-bottom: 5px;
            }

            a {
                color: #333333;
                text-decoration: none;
                font-weight: bold;
            }

            a:hover {
                text-decoration: underline;
            }

            #figure-photo {
                float: left;
                margin: 10px 40px 0 0;
            }

            #div-list {
                display: flex;
                flex-wrap: wrap;
            }

            #ul-skill {
                display: flex;
                flex-wrap: wrap;
                max-width: 300px;
                padding-left: 25px;
            }

            #ul-skill > li {
                margin-right: 30px;
                width: 100px;
            }

            #ul-skill > li::before {
                content: '- '
            }

        </style>
